        <section id = "inventory">

            <table>
                <tr>
                    <th>Item</th>
                    <th>ATK bonus</th>

                    <th>DEF bonus</th>
                    <th>HP bonus</th>

                    </td>

                    </td>

                </tr>
            </table>
        </section>


    </section>
